The transport phenomenon of nano Williamson fluid over a non-linear stretching plate of changeable thickness have been investigated in the presence of MHD, radiative heat, viscous heating, Joule heating and multiple slips effects. The statistical approach has been adopted for the analysis. The major outcomes of this report are:
• the Brownian motion and thermophoresis slip mechanisms due to the presence of nanoparticles have momentous effects on the transport phenomenon and heat transfer;
• the heat transfer rate is highly affected by variable thermal conductivity and Brownian motion aspects;
• the regression line for the Nusselt number as a function of thermal conductivity and Brownian motions is:
Local Nusselt number ¼ 0:512609853þ0:069565018Eþ0:011008847 Nbt; • the skin friction coefficient at the sheet increases via velocity slip at the rate−1.531709991; • the velocity layer width is diminished through the magnetic field when as energy
layer thickness become wider for the influence of magnetism;
• the temperature field is proportional to Williamson fluid parameter;
• effect of variable thickness is significant on shear stress and it increases the friction factor; and
• the results of flat stretching sheet can recovered when m¼ 1.
